" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Technetium Tc-99m gluceptate: Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?41/52/42818?source=see_link\">",
"    see \"Technetium Tc-99m gluceptate: Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F13206419\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      DRAXIMAGE&reg; Gluceptate",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F13206421\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Radiopharmaceutical",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F13206491\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      Brain imaging:",
"     </b>",
"     I.V. (based on 70 kg patient): 15-20 mCi (555-740 MBq)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      Renal imaging:",
"     </b>",
"     I.V. (based on 70 kg patient): 10-15 mCi (370-555 MBq)",
"    </p>",
"   </div>",
"   <div class=\"block adm drugH1Div\" id=\"F13253413\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Administration",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Patients should be adequately hydrated prior to dosing; instruct patients to void frequently for 4-6 hours following administration to decrease radiation exposure to the bladder.",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F13206440\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Evaluation of renal and brain perfusion",
"    </p>",
"   </div>",
"   <div class=\"block mst drugH1Div\" id=\"F13255274\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Medication Safety Issues",
"    </span>",
"    <div class=\"collapsible\">",
"     <span class=\"collapsible-title\">",
"      Other safety concerns:",
"     </span>",
"     <div class=\"collapsible-wrap\">",
"      <p style=\"text-indent:-2em;margin-left:4em;\">",
"       Radiopharmaceutical: Use appropriate precaution for handling, disposal, and minimizing exposure to patients and healthcare personnel. Use under supervision of experienced personnel. Should be stored in original lead container or adequate radiation shield.",
"      </p>",
"     </div>",
"    </div>",
"   </div>",
"   <div class=\"block ars drugH1Div\" id=\"F13206506\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Frequency not defined: Dermatologic: Dermal hypersensitivity",
"    </p>",
"   </div>",
"   <div class=\"block war drugH1Div\" id=\"F13206441\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Warnings/Precautions",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      <i>",
"       Special handling:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Radiopharmaceutical: Use appropriate precautions for handling, disposal, and minimizing exposure to patients and healthcare personnel. Use only  under supervision of individuals who have received training in the handling of radioactive materials and who are authorized by the applicable regulatory authority.",
"     <b>",
"      Note:",
"     </b>",
"     Contents of kit are not radioactive; however, adequate shielding is required after addition of radioactive material.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      <i>",
"       Disease-related concerns:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Renal impairment: Patients with renal disease may have delayed elimination, therefore decreasing quality of images.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      <i>",
"       Other warnings/precautions:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Appropriate use: Patients should be adequately hydrated prior to dosing; instruct patients to void frequently for 4-6 hours following administration to decrease radiation exposure to the bladder.",
"    </p>",
"   </div>",
"   <div class=\"block prf drugH1Div\" id=\"F13206472\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Risk Factor",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     C (",
"     <a class=\"graphic graphic_table\" href=\"UTD.htm?16/42/17068\">",
"      show table",
"     </a>",
"     )",
"    </p>",
"   </div>",
"   <div class=\"block pri drugH1Div\" id=\"F13206473\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Implications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Animal studies have not been conducted. There are no adequate and well-controlled studies in pregnant women. Radiopharmaceuticals have the potential to cause fetal harm. Use during pregnancy only if clearly needed.",
"    </p>",
"   </div>",
"   <div class=\"block lac drugH1Div\" id=\"F13206478\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Lactation",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Enters breast milk/not recommended",
"    </p>",
"   </div>",
"   <div class=\"block brc drugH1Div\" id=\"F17916861\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Breast-Feeding Considerations",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Technetium Tc 99m gluceptate is excreted in breast milk. Breast-feeding is not recommended by the manufacturer.",
"    </p>",
"   </div>",
"  </div>",
