var content_f1_52_1860=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RADIOL%2F83106&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RADIOL%2F83106&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 594px\">",
"   <div class=\"ttl\">",
"    Vertebral burst fracture of the lumbar spine: Plain radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 574px; height: 480px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The x-rayx&nbsp;are from a 37-year-old female drug addict who jumped from a building in a suicide attempt. The plain x-rays in lateral projection (A) and AP projection (B) of the lumbar spine show a burst fracture of L1 characterized by loss of height and malposition of the L1 vertebral body with posterior retropulsion into the spinal canal (white arrow). The posterior elements are splayed as reflected in the widening of the pedicles (red arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Frymoyer JW, Wiesel SW, et al. The Adult and Pediatric Spine. Lippincott Williams &amp; Wilkins, Philadelphia 2004. Copyright &copy; 2004 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
