"   <div class=\"block pha drugH1Div\" id=\"F230461\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Keratinocytes in the sebaceous follicle become less adherent which allows for easy removal; inhibits microcomedone formation and eliminates lesions already present",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F230476\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Minimal",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic for the small amount absorbed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine and feces",
"    </p>",
"   </div>",
