"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F230461\">",
"      Mechanism of Action",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F230476\">",
"      Pharmacodynamics/Kinetics",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a href=\"#references\">",
"      REFERENCES",
"     </a>",
"    </li>",
"   </ul>",
"  </div>",
