var title_f1_52_1868="Clinical features UV";
var content_f1_52_1868=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F82169&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F82169&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical features of urticarial vasculitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Cutaneous features",
"       </td>",
"       <td class=\"subtitle1\">",
"        Systemic features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Erythematous urticarial papules and plaques (wheals), angioedema, dermographism, annular erythema",
"       </td>",
"       <td>",
"        Musculoskeletal: arthralgia, arthritis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Less common",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Urticarial lesions with residual hyperpigmentation and/or purpura",
"       </td>",
"       <td>",
"        Respiratory: cough, dyspnea, hemoptysis, COPD, asthma, pleural effusion",
"        <br/>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Renal disease: proteinuria,  hematuria, glomerulonephritis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gastrointestinal: substernal pain, abdominal pain, nausea, vomiting, diarrhea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Rare",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Erythema multiforme-like lesions, livedo reticularis, Raynaud's phenomenon, laryngeal edema",
"       </td>",
"       <td>",
"        Cardiac: pericarditis, pericardial effusion, cardiac tamponade",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ophthalmologic: conjunctivitis, episcleritis, uveitis, geographic serpiginous",
"choroidopathy, visual loss",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Other: fever, splenomegaly, lymphadenopathy, cold sensitivity,",
"reversible tracheal stenosis&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Very rare",
"       </td>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        &nbsp;",
"       </td>",
"       <td>",
"        CNS: pseudotumor cerebri, cranial nerve&nbsp;palsies, aseptic meningitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Miscellaneous: transverse myelitis, cardiac valve disease, optic atrophy, Jaccoud's syndrome",
"(chronic post-rheumatic fever arthropathy), peripheral neuropathy,",
"pleuritis&nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
